import React, { useState } from 'react';
const Navbar = () => {

  return(
    <nav className='nav'>
      
        <a href="/" className='site-title'>Course Curator</a>

          <ul>
            <li className='active'>
              <a href="#" className='nav__link'>Solutions</a>
            </li>
            <li className='active'>
              <a href="#" className='nav__link'>Projects</a>
            </li>
            <li className='active'>
              <a href="#" className='btn'>Contact </a>
            </li>
          </ul>
      </nav>
  );
};

export default Navbar;
